import React from 'react'
import ReactDOM from 'react-dom';
import './FormSignIn.css'

class FormSignIn extends React.Component {
  constructor(props) {
       super(props);
       this.state = {
         isBtnClicked: false
       };
  }
  onBtnClicked(event) {
      this.setState({isBtnClicked: true})
  }
  render() {
      return (
      <div className='form-content-right col-md-6 text-center'>
        <div className='form-signin'>
          <h1 className='welcome1'> ברוכה הבאה! </h1>
          <p className='msg'> יש לך חשבון כנסי עכשיו ותהני מהטבות</p>

          <button
              className='sign-in-btn'
              type='button'
              onClick={this.onBtnClicked.bind(this)}>
              כניסה
          </button>
        </div>
      </div>
    );
  }
}

export default FormSignIn;
